---

# FaceIQ Labs - Facial Analysis Deep Dive

## Core Technology

### MediaPipe Face Landmarker
They use **Google's MediaPipe Face Landmarker** model:
```
Model: storage.googleapis.com/mediapipe-models/face_landmarker/face_landmarker/float16/1/face_landmarker.task
Library: @mediapipe/tasks-vision (from cdn.jsdelivr.net)
```

This model provides:
- **478 facial landmarks** for frontal view
- **106 landmarks** for side profile (as seen in their API)

---

## API Routes Breakdown

### 1. `/api/auth/session` (GET)
**Purpose:** Check user authentication state

```json
{
  "user": {
    "name": "Isaac",
    "email": "user@email.com",
    "image": "https://...googleusercontent.com/...",
    "id": "cmjbvvywi27ga2wfq64132510"
  },
  "expires": "2026-01-17T21:22:19.451Z"
}
```

---

### 2. `/api/faces` (GET/POST)
**Purpose:** List or create face analyses

**POST Request - Creates new face analysis:**
```json
// Response
{
  "success": true,
  "face": {
    "id": "cmjbyar435k1o0aeeyobxcnc9",
    "createdAt": "2025-12-18T21:26:51.075Z",
    "images": {
      "frontUrl": "https://y3rtbuzfi5kn7frq.public.blob.vercel-storage.com/faces/.../front-....webp",
      "sideUrl": "https://y3rtbuzfi5kn7frq.public.blob.vercel-storage.com/faces/.../side-....webp"
    }
  }
}
```

---

### 3. `/api/side-landmarks` (POST) - THE KEY ENDPOINT
**Purpose:** Process side profile photo and extract landmarks

**Response Structure (106 landmarks):**
```json
{
  "success": true,
  "data": {
    "rotationAngle": -0.411,      // Face rotation in radians
    "direction": "right",          // Which direction face is facing
    "center": {                    // Face center point
      "x": 381.03,
      "y": 479.53
    },
    "crop": {                      // Auto-crop suggestion
      "x": 154,
      "y": 228,
      "width": 505,
      "height": 505,
      "scale": 2.029
    },
    "bbox": [317, 316, 495, 644],  // Bounding box [x1, y1, x2, y2]
    "landmarks": [                 // 106 facial landmarks
      {"x": 484.79, "y": 623.10},  // Landmark 0
      {"x": 300.03, "y": 476.74},  // Landmark 1
      // ... 104 more landmarks
    ]
  }
}
```

