### 6. `/api/faces/:id/surgery-consent` (POST)
**Purpose:** Record user consent for surgery-related features

---

## How The Calculations Work

### Step 1: Image Upload & Processing
```
1. User uploads front + side photos
2. Images compressed with browser-image-compression library
3. Images uploaded to Vercel Blob Storage
4. Face record created in database
```

### Step 2: Landmark Detection (Client-Side)
```javascript
// Using MediaPipe Face Landmarker
import { FaceLandmarker, FilesetResolver } from "@mediapipe/tasks-vision";

const faceLandmarker = await FaceLandmarker.createFromOptions(vision, {
  baseOptions: {
    modelAssetPath: "https://storage.googleapis.com/mediapipe-models/face_landmarker/face_landmarker/float16/1/face_landmarker.task",
    delegate: "GPU"
  },
  runningMode: "IMAGE",
  numFaces: 1,
  outputFacialTransformationMatrixes: true,
  outputFaceBlendshapes: true
});

// Detect landmarks
const result = faceLandmarker.detect(imageElement);
// Returns 478 landmarks for frontal, 106 for profile
```

### Step 3: Common Facial Measurements (Likely Calculations)

Based on standard facial analysis, they likely calculate:

#### Facial Ratios
```javascript
// FWHR (Face Width-to-Height Ratio)
const fwhr = bizygomatic_width / upper_face_height;
// Uses landmarks: cheekbones (left/right) / (eyebrow to upper lip)

// Golden Ratio Check
const phi = 1.618;
const goldenRatio = face_length / face_width;

// Facial Thirds
const upperThird = hairline_to_glabella;
const middleThird = glabella_to_subnasale; 
const lowerThird = subnasale_to_menton;
```

#### Key Landmark Indices (MediaPipe 478)
```javascript
const LANDMARKS = {
  // Eyes
  leftEyeOuter: 33,
  leftEyeInner: 133,
  rightEyeInner: 362,
  rightEyeOuter: 263,

  // Nose
  noseTip: 4,
  noseBase: 2,

  // Mouth
  upperLipTop: 13,
  lowerLipBottom: 14,
  mouthLeft: 61,
  mouthRight: 291,

  // Face outline
  chin: 152,
  leftCheek: 234,
  rightCheek: 454,

  // Eyebrows
  leftBrowOuter: 70,
  rightBrowOuter: 300
};
```

#### Profile Measurements (Side View)
```javascript
// Nasofrontal Angle (between forehead and nose bridge)
const nasofrontalAngle = calculateAngle(
  landmarks[glabella],
  landmarks[nasion],
  landmarks[pronasale]
);

// Nasolabial Angle (nose to upper lip)
const nasolabialAngle = calculateAngle(
  landmarks[columella],
  landmarks[subnasale],
  landmarks[labrale_superius]
);

// Gonial Angle (jaw angle)
const gonialAngle = calculateAngle(
  landmarks[tragus],
  landmarks[gonion],
  landmarks[menton]
);

// Chin Projection
const chinProjection = distance(landmarks[subnasale], landmarks[pogonion]);
```

---

## Recommended Implementation Approach

### Database Schema (Prisma)
```prisma
model Face {
  id            String   @id @default(cuid())
  userId        String
  frontUrl      String
  sideUrl       String?
  frontLandmarks Json?
  sideLandmarks  Json?
  measurements  Json?
  createdAt     DateTime @default(now())
  user          User     @relation(fields: [userId], references: [id])
}

model User {
  id            String   @id @default(cuid())
  email         String   @unique
  name          String?
  image         String?
  faces         Face[]
  subscription  Subscription?
}
```

### API Route Example
```typescript
// /api/side-landmarks/route.ts
import { FaceLandmarker } from "@mediapipe/tasks-vision";

export async function POST(req: Request) {
  const { imageUrl } = await req.json();

  // Load image and detect landmarks
  const landmarks = await detectSideLandmarks(imageUrl);

  // Calculate rotation and direction
  const rotationAngle = calculateFaceRotation(landmarks);
  const direction = determineFaceDirection(landmarks);

  // Calculate bounding box and crop
  const bbox = calculateBoundingBox(landmarks);
  const crop = calculateOptimalCrop(bbox);

  return Response.json({
    success: true,
    data: {
      rotationAngle,
      direction,
      center: calculateCenter(landmarks),
      crop,
      bbox,
      landmarks
    }
  });
}
```

---

